import useForm from "./UseForm";

const initialForm = {
  name: "Diego",
  image: ``,
  life: 50,
  attack: 50,
  defense: 50,
  velocity: 50,
  height: "",
  weight: "",
  Types: [],
};

const validationsForm = (form) => {
let errors = {}
if (!form.name.trim()) {
  errors.name = "El campo del nombre es requerido"
}

return errors
};

const Form2 = () => {
  const {
    form,
    errors,
    loading,
    response,
    handleChange,
    handleBlur,
    handleSubmit,
  } = useForm(initialForm, validationsForm);

  return (
    <div>
      <div>Crearemos nuestro Pokemón</div>
      <form onSubmit={handleSubmit}>
        <div>
          <label htmlFor=""> Ingresa un nombre(*): </label>
          <input
            type="text"
            name="name"
            placeholder="Escribe un Nombre"
            onChange={handleChange}
            onBlur={handleBlur}
            value={form.name}
            required
          />
          {/* {errors.name && <span>{errors.name}</span>} */}
        </div>

        <div>
          <label htmlFor=""> Inserte una imagen(*): </label>
          <input
            type="text"
            name="image"
            value={form.image}
            onChange={handleChange}
            onBlur={handleBlur}
            required
          />
          {/* {errors.image && <span>{errors.image}</span>} */}
        </div>

        <div>
          <label htmlFor=""> Vida(*): </label>
          <input
            type="range"
            min={1}
            max={200}
            name="life"
            value={form.life}
            onChange={handleChange}
            onBlur={handleBlur}
            required
          />
          <span>{form.life}</span>
          {/* {errors.life &&<span>{errors.life}</span>} */}
        </div>

        <div>
          <label htmlFor=""> Ataque(*): </label>
          <input
            type="range"
            min={1}
            max={200}
            name="attack"
            value={form.attack}
            onChange={handleChange}
            onBlur={handleBlur}
            required
          />
          <span>{form.attack}</span>
          {/* {errors.attack &&<span>{errors.attack}</span>} */}
        </div>

        <div>
          <label htmlFor=""> Defensa(*): </label>
          <input
            type="range"
            min={1}
            max={200}
            name="defense"
            value={form.defense}
            onChange={handleChange}
            onBlur={handleBlur}
            required
          />
          <span>{form.defense}</span>
          {/* {errors.defense &&<span>{errors.defense}</span>} */}
        </div>

        <div>
          <label htmlFor=""> Velocidad: </label>
          <input
            type="range"
            min={1}
            max={200}
            name="velocity"
            value={form.velocity}
            onChange={handleChange}
            onBlur={handleBlur}
          />
          <span>{form.velocity}</span>
        </div>

        <div>
          <label htmlFor=""> Altura: </label>
          <input
            type="text"
            name="height"
            value={form.height}
            onChange={handleChange}
            // className={style.input_Height}
            onBlur={handleBlur}
          />
          <span> Metros</span>
        </div>

        <div>
          <label htmlFor=""> Peso: </label>
          <input
            type="text"
            name="weight"
            value={form.weight}
            onChange={handleChange}
            // className={style.input_Weight}
            onBlur={handleBlur}
          />
          <span> Kg.</span>
        </div>

        {/* <div className={style.div_contenedor_label}>
          <div>
            <label htmlFor="">Tipos: </label>
          </div>
          {typesPokemon.map((tipo, index) => {
            return (
              <label className={style.label_Form} key={index} htmlFor="">
                {tipo}:
                {form.Types.length === 2 &&
                arrayType.includes(form.Types[0]) &&
                arrayType.includes(form.Types[1]) ? (
                  <input
                    type="checkbox"
                    value={tipo}
                    onClick={introduceTypeHandle}
                    id={index + 1}
                    onBlur={handleBlur}
                    required
                    disabled
                  />
                ) : (
                  <input
                    type="checkbox"
                    value={tipo}
                    id={index + 1}
                    onClick={introduceTypeHandle}
                    onBlur={handleBlur}
                    required
                  />
                )}
              </label>
            );
          })}
        </div> */}

        <button type="submit">Create Pokemón</button>
      </form>

      <h6> (*) Se deben rellenar obligatoriamente</h6>
    </div>
  );
};

export default Form2;
